import logo from './logo.svg';
import './App.css';

import * as d3 from 'd3';

import miserableJSON from '../src/miserables.json';

const jsondata = miserableJSON;

function App() {


useEffect(() => {
  drawChart();
});

function drawChart() {
  const data = [12, 5, 6, 6, 9, 10];    
  const svg = d3.select("body").append("svg").attr("width", 700).attr("height", 300);

  svg.selectAll("rect")
      .data(data)
      .enter()
      .append("rect")
      .attr("x", (d, i) => i * 70)
      .attr("y", (d, i) => 300 - 10 * d)
      .attr("width", 65)
      .attr("height", (d, i) => d * 10)
      .attr("fill", "green")
}

  return (
    <div className="App">
      {/* <svg id='viz'></svg> */}
    </div>
  );
}

export default App;
